import React from "react"
import { connect } from 'react-redux'
import Card from 'react-bootstrap/Card'


const TransactionPanel = () => {

  const showTransactions = (transactions) => { 
    return (
      <Card>
        <Card.body>
          <Card.title> Transaction Name </Card.title>
        </Card.body>
      </Card>
    )
  }

  return (
    <div className="trans"> I am TransactionPanel </div>
  )

}

const mapStateToProps = (state) => {
  return {
    transactions: state.linkReducer.accounts
  }
}

const mapDispacthToProps = (dispatch) => {
  return {
    dispatch
    // inc: (() => dispatch({type: "inc"}))
  }
}

export default connect(mapStateToProps, mapDispacthToProps)(TransactionPanel)
